  return (
    <div
      onMouseOver={() => {
        setProductImage(project.title);
      }}
      className={`card`}
    >
      <div className="flex">
        <a
          target="_blank"
          rel="noreferrer"
          href={project.url}
          className="title"
        >
          {project.title}
        </a>
        <strong>‚óè {project.type}</strong>
      </div>
      <hr />
    </div>
  );
};

export default Card;
